## I18n Violations in a Library Platform

### 1. Hardcoded Text in JavaScript

**Violation:**
```javascript
function displayBookDetails(book) {
  alert(`You have borrowed the book "${book.title}" by ${book.author}.`);
}
```

**Explanation:** The text within the alert is hardcoded in English. If the platform needs to support other languages, this approach won't work.

**Inconsistent File Structure Issue:** The text is scattered throughout the JavaScript files, making it difficult to manage translations.

### 2. Using `new Date()` for Date Formatting

**Violation:**
```javascript
function displayDueDate(book) {
  const dueDate = new Date(book.dueDate);
  document.getElementById('due-date').innerText = dueDate.toLocaleDateString();
}
```

**Explanation:** The date formatting is dependent on the user's browser locale, which might not be consistent with the platform's language settings.

**Inconsistent File Structure Issue:** Date formatting logic is mixed with other business logic, making it hard to maintain and update.

